/* (A) FIXED WRAPPER */
.hwrap {
  overflow: hidden; /* HIDE SCROLL BAR */
  background: rgba(255, 255, 255, 0);
  width: calc(100% - 1vw);
  margin-top: 0;
  font-size: calc(13px + 0.1vw);
  color: #696969;
  margin-bottom: 1vh;
  margin-left: 0.5vw;
  margin-right: 0.5vw;
}

/* (B) MOVING TICKER WRAPPER */
.hmove { display: flex; }

/* (C) ITEMS - INTO A LONG HORIZONTAL ROW */
.hitem {
  flex-shrink: 0;
  width: 25%;
  box-sizing: border-box;
  padding-left: 10px;
  padding-right: 10px;
  text-align: center;
}

/* (D) ANIMATION - MOVE ITEMS FROM RIGHT TO LEFT */
/* 4 ITEMS -400%, CHANGE THIS IF YOU ADD/REMOVE ITEMS */
@keyframes tickerh {
  0% { transform: translate3d(-25%, 0, 0); }
  100% { transform: translate3d(-200%, 0, 0); }
}
.hmove { animation: tickerh linear 18s infinite; animation-play-state: running; }
.hmove:hover { animation-play-state:paused; }


/* (A) FIXED WRAPPER */
.hwrap-message {
  overflow: hidden; /* HIDE SCROLL BAR */
  background: rgba(255, 255, 255, 0);
  width: 100%;
  font-size: 13px;
  color: #696969;
  margin-bottom: 1vh;
