  0% { transform: translate3d(0, 0, 0); }
  100% { transform: translate3d(-1200px, 0, 0); }
}
.hmove-message { animation: tickerh-message linear 18s infinite; animation-play-state: running; }
.hmove-message:hover { animation-play-state:paused; }

a[href], input[type='submit'], input[type='image'], label[for], select, button, .pointer {
  cursor: pointer;
}

select {
  -webkit-appearance: none;
     -moz-appearance: none;
          appearance: none;
  background-color: transparent;
  border: none;
  margin: auto;
  width: 100%;
  height: 40px;
  font-family: inherit;
  font-size: inherit;
  cursor: inherit;
  line-height: 1em;
  z-index: 1;
  outline: none;
  color: #696969;
  height: 40px;
  margin-top: -1px;
}
select::-ms-expand {
  display: none;
}

.select {
  display: inline-flex;
  grid-template-areas: "select";
  align-items: center;
  vertical-align: middle;
  position: relative;
  min-width: calc(100% - 30px);
  max-width: 30ch;
  border: 1px solid var(--select-border);
  border-radius: 10px;
  padding: 0.0em 0.8em 0.0em 1.0em;
  cursor: pointer;
  background-color: #fff;
  background-image: linear-gradient(to top, #f9f9f9, #fff 33%);
  height: 40px;
  width: 50%;
  margin: auto;
  margin-left: 30px;
}
.select select, .select::after {
  grid-area: select;
}
.select:not(.select--multiple)::after {
  content: "";
  justify-self: end;
  width: 0.8em;
  height: 0.5em;
  background-color: var(--select-arrow);
  -webkit-clip-path: polygon(100% 0%, 0 0%, 50% 100%);
          clip-path: polygon(100% 0%, 0 0%, 50% 100%);
}

select:focus + .focus {
  position: absolute;
  top: -1px;
  left: -1px;
  right: -1px;
  bottom: -1px;
  border-radius: inherit;
}

select[multiple] {
  padding-right: 0;
  /*
   * Safari will not reveal an option
   * unless the select height has room to 
   * show all of it
   * Firefox and Chrome allow showing 
   * a partial option
   */
  height: 6rem;
  /* 
   * Experimental - styling of selected options
   * in the multiselect
   * Not supported crossbrowser
   */
}
select[multiple] option {
  white-space: normal;
  outline-color: var(--select-focus);
}

.select--disabled {
  cursor: not-allowed;
  background-color: #eee;
  background-image: linear-gradient(to top, #ddd, #eee 33%);
}

/* The switch - the box around the slider */
.switch {
  position: relative;
  display: inline-block;
  width: 60px;
  height: 25px;
}

/* Hide default HTML checkbox */
.switch input {
  opacity: 0;
  width: 0;
  height: 0;
}

/* The slider */
.slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgb(4, 201, 118, 0.5);
  background-position: calc(100% - 8px) calc(100% - 4px);
  background-repeat: no-repeat;
  background-size: auto 17px;
  -webkit-transition: .4s;
  transition: .4s;
}

.slider:before {
  position: absolute;
  content: "";
  height: 17px;
  width: 17px;
  left: 4px;
  bottom: 4px;
  background-color: white;
  -webkit-transition: .4s;
  transition: .4s;
}

input:checked + .slider {
  background-color: rgb(4, 201, 118, 0.5);
  background-position: calc(4px) calc(4px);
  background-repeat: no-repeat;
  background-size: auto 17px;
}

input:focus + .slider {
  box-shadow: 0 0 1px rgb(0, 0, 0, 0);
}

input:checked + .slider:before {
  -webkit-transform: translateX(35px);
  -ms-transform: translateX(35px);
  transform: translateX(35px);
}

/* Rounded sliders */
.slider.round {
  border-radius: 25px;
}

.slider.round:before {
  border-radius: 50%;
}

